import React, { Component } from 'react';

import './flights-table.css';

export default class FlightsTable extends Component {

  render() {
    return (
      <ul className="flights-table list-group">
        <li className="list-group-item">
          Luke Skywalker
        </li>
        <li className="list-group-item">
          Darth Vader
        </li>
        <li className="list-group-item">
          R2-D2
        </li>
      </ul>
    );
  }
};
